         <div className="header-dashboard">
					<div className="container">
						<div className="header-wrap">
							<div className="header-child1">
								<h3>DASHBOARD</h3>
							</div>
							<div className="header-child2">
								<a href='#'><img src={menu}></img></a>
							</div>
						</div>
					</div>
				</div>
         <div className="menu slide-menu-right menu-list-wrp">
                  <button class="close-menu"><img src={crosss} className="img-close" /></button>
                  <ul className="listmenu-desktop">
                  <li> <Link to="#" className="close-menu"><span>01</span>MANA POOLS</Link></li>
                  <li><Link to="#" className="close-menu"><span>02</span>GOLD FARMS</Link></li>
                  <li><Link to="#" className="close-menu"><span>03</span>WHITEPAPER</Link></li>
                  <li><Link to="#" className="close-menu"><span>04</span>PITCH</Link></li>
                  <li><Link to="3" className="close-menu"><span>05</span>FAQ</Link></li>
                  <li><Link to="3" className="close-menu"><span>06</span>PARTNERS</Link></li>
                  <li><Link to="#" className="close-menu"><span>07</span>OUR TEAM</Link></li>
                  <li><Link to="#" className="close-menu"><span>08</span>AUDIT</Link></li>
                </ul>

          </div>
       </div>
		);

}


